-- ----------------------------
-- View structure for booksuppliersview
-- ----------------------------
DROP VIEW IF EXISTS `booksuppliersview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `booksuppliersview` AS select `b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`s`.`SupplierID` AS `SupplierID`,`s`.`Name` AS `SupplierName`,`bs`.`SupplyQuantity` AS `SupplyQuantity` from ((`books` `b` join `booksupplies` `bs` on((`b`.`BookID` = `bs`.`BookID`))) join `suppliers` `s` on((`bs`.`SupplierID` = `s`.`SupplierID`)));

-- ----------------------------
-- View structure for customerordersview
-- ----------------------------
DROP VIEW IF EXISTS `customerordersview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `customerordersview` AS select `c`.`CustomerID` AS `CustomerID`,`c`.`Name` AS `CustomerName`,`o`.`OrderID` AS `OrderID`,`o`.`OrderDate` AS `OrderDate`,`o`.`TotalAmount` AS `TotalAmount` from (`customers` `c` join `orders` `o` on((`c`.`CustomerID` = `o`.`CustomerID`)));

-- ----------------------------
-- View structure for customerpurchasehistoryview
-- ----------------------------
DROP VIEW IF EXISTS `customerpurchasehistoryview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `customerpurchasehistoryview` AS select `c`.`CustomerID` AS `CustomerID`,`c`.`Name` AS `Name`,`o`.`OrderID` AS `OrderID`,`o`.`OrderDate` AS `OrderDate`,`od`.`BookID` AS `BookID`,`od`.`Quantity` AS `Quantity` from ((`customers` `c` join `orders` `o` on((`c`.`CustomerID` = `o`.`CustomerID`))) join `orderdetails` `od` on((`o`.`OrderID` = `od`.`OrderID`)));

-- ----------------------------
-- View structure for lowstockbooksview
-- ----------------------------
DROP VIEW IF EXISTS `lowstockbooksview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `lowstockbooksview` AS select `b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,`b`.`StockQuantity` AS `StockQuantity`,coalesce(`bs`.`RequiredQuantity`,0) AS `RequiredQuantity` from (`books` `b` left join `bookshortages` `bs` on((`b`.`BookID` = `bs`.`BookID`))) where (`b`.`StockQuantity` < 200);

-- ----------------------------
-- View structure for pendingbookshortagesview
-- ----------------------------
DROP VIEW IF EXISTS `pendingbookshortagesview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `pendingbookshortagesview` AS select `bookshortages`.`RegistrationID` AS `RegistrationID`,`books`.`Title` AS `Title`,`bookshortages`.`RequiredQuantity` AS `RequiredQuantity`,`bookshortages`.`RegistrationDate` AS `RegistrationDate` from (`bookshortages` join `books` on((`bookshortages`.`BookID` = `books`.`BookID`))) where (`bookshortages`.`ProcessingStatus` = 'Pending');

-- ----------------------------
-- View structure for salesreportview
-- ----------------------------
DROP VIEW IF EXISTS `salesreportview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `salesreportview` AS select `orders`.`OrderDate` AS `OrderDate`,count(`orders`.`OrderID`) AS `NumberOfOrders`,sum(`orders`.`TotalAmount`) AS `TotalSales`,avg(`orders`.`TotalAmount`) AS `AverageOrderValue` from `orders` group by `orders`.`OrderDate`;

-- ----------------------------
-- View structure for supplierperformanceview
-- ----------------------------
DROP VIEW IF EXISTS `supplierperformanceview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `supplierperformanceview` AS select `s`.`SupplierID` AS `SupplierID`,`s`.`Name` AS `Name`,count(`po`.`PurchaseOrderID`) AS `TotalOrders`,sum((case when (`po`.`ArrivalStatus` = 'Received') then 1 else 0 end)) AS `OrdersReceived` from (`suppliers` `s` join `purchaseorders` `po` on((`s`.`SupplierID` = `po`.`SupplierID`))) group by `s`.`SupplierID`;

-- ----------------------------
-- View structure for supplieruniquebooksview
-- ----------------------------
DROP VIEW IF EXISTS `supplieruniquebooksview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `supplieruniquebooksview` AS select `s`.`SupplierID` AS `SupplierID`,`s`.`Name` AS `SupplierName`,`b`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,sum(`bs`.`SupplyQuantity`) AS `TotalSupplyQuantity` from ((`suppliers` `s` join `booksupplies` `bs` on((`s`.`SupplierID` = `bs`.`SupplierID`))) join `books` `b` on((`bs`.`BookID` = `b`.`BookID`))) group by `s`.`SupplierID`,`s`.`Name`,`b`.`BookID`,`b`.`Title`;

-- ----------------------------
-- View structure for topsellingbooksview
-- ----------------------------
DROP VIEW IF EXISTS `topsellingbooksview`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `topsellingbooksview` AS select `od`.`BookID` AS `BookID`,`b`.`Title` AS `Title`,sum(`od`.`Quantity`) AS `TotalSold` from (`orderdetails` `od` join `books` `b` on((`od`.`BookID` = `b`.`BookID`))) group by `od`.`BookID` order by `TotalSold` desc;

-- ----------------------------
-- Triggers structure for table OrderDetails
-- ----------------------------
DROP TRIGGER IF EXISTS `HandleBookShortageAfterInsert`;
delimiter ;;
CREATE TRIGGER `HandleBookShortageAfterInsert` AFTER INSERT ON `OrderDetails` FOR EACH ROW BEGIN
    DECLARE currentStock INT;
    DECLARE shortageAmount INT;

    -- 获取当前库存量
    SELECT StockQuantity INTO currentStock
    FROM Books
    WHERE BookID = NEW.BookID;

    -- 计算缺书量
    SET shortageAmount = NEW.Quantity - currentStock;

    -- 如果需要，添加缺书记录
    IF shortageAmount > 0 THEN
        VALUES (NEW.BookID, CURDATE(), shortageAmount, 'Pending');
    END IF;
END
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
