INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (60, 'Fundamentals of HIV Medicine', 'William David Hardy', 'Oxford University Press', 60.13, 'AIDS (Disease)', 'http://books.google.com/books/content?id=kOIwDgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Completely updated for 2017, Fundamentals of HIV Medicine is a comprehensive clinical care publication for the treatment of HIV/AIDS. Published by the American Academy of HIV Medicine, the book offers physicians, pharmacists, nurse practitioners, and other care providers the most up-to-date overview of the latest HIV treatments and guidelines plus online access to CME. The online access expires August 2018. Embodying the AAHIVM\'s commitment to promoting uniform excellence in care of seropositive patients, Fundamentals of HIV Medicine 2017 empowers health professionals to deliver standardized, life-sustaining treatment to the patients who need it most. It will serve as an essential clinical reference and provide valuable career enrichment to users across the spectrum of HIV care, treatment, and prevention.', 181, 'Note discussion catch various bit daughter someone.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (61, 'The B2B Social Media Book', 'Kipp Bodnar, Jeffrey L. Cohen', 'John Wiley & Sons', 61.92, 'Business & Economics', 'http://books.google.com/books/content?id=wvDVl0uo6R8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Advance your B2B marketing plans with proven social media strategies Learn social media\'s specific application to B2B companies and how it can be leveraged to drive leads and revenue. B2B marketers are undervalued and under appreciated in many companies. Social media and online marketing provide the right mix of rich data and reduction in marketing expenses to help transform a marketer into a superstar. The B2B Social Media Book provides B2B marketers with actionable advice on leveraging blogging, LinkedIn, Twitter, Facebook and more, combined with key strategic imperatives that serve as the backbone of effective B2B social media strategies. This book serves as the definitive reference for B2B marketers looking to master social media and take their career to the next level. Describes a methodology for generating leads using social media Details how to create content offers that increase conversion rates and drive leads from social media Offers practical advice for incorporating mobile strategies into the marketing mix Provides a step-by-step process for measuring the return on investment of B2B social media strategies The B2B Social Media Book will help readers establish a strong social media marketing strategy to generate more leads, become a marketing superstar in the eye of company leaders, and most importantly, contribute to business growth.', 284, 'Us lead respond arm live.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (62, 'Media Life', 'Mark Deuze', 'John Wiley & Sons', 75.09, 'Social Science', 'http://books.google.com/books/content?id=ejmwAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Research consistently shows how through the years more of our time gets spent using media, how multitasking our media has become a regular feature of everyday life, and that consuming media for most people increasingly takes place alongside producing media. Media Life is a primer on how we may think of our lives as lived in rather than with media. The book uses the way media function today as a prism to understand key issues in contemporary society, where reality is open source, identities are - like websites - always under construction, and where private life is lived in public forever more. Ultimately, media are to us as water is to fish. The question is: how can we live a good life in media like fish in water? Media Life offers a compass for the way ahead.', 3, 'My state everyone TV soldier.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (63, 'Jennifer West', 'Andy Campbell, Jennifer West, Norman M. Klein, Chelsea Weathers', 'Unknown', 82.99, 'Art', 'http://books.google.com/books/content?id=2UzOzgEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', 'West\'s material experiments in film and art explore Southern California\'s changing geography This debut monograph brings together nearly a decade of \"analogital\" experiments in film, sculpture and installation by Jennifer West (born 1966)--one of the most committed artists working on the West Coast today. Saturated in a history of avant-garde and Third World cinema (not to mention HIV/AIDS activism and the incipient Riot Grrrl movement) since she was an undergraduate at Evergreen State College, West\'s work today treads similar ground: challenging the utopianism of new media adoptees as well as the nostalgia of analog-only film adherents. The 11 projects reproduced in the book, all produced between 2014 and 2021, fall under the heading of Media Archaeology, and reveal the historical and material promiscuity of West\'s experiments in film and art, often tied to the changing geography of Los Angeles and its surrounds.', 738, 'Another fly choose make government spend.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (64, 'The Media Book', 'Chris Newbold, Oliver Boyd-Barrett, Hilde van den Bulck', 'Hodder Education', 90.29, 'Social Science', 'http://books.google.com/books/content?id=qtcYtAEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', 'The Media Book provides today\'s students with a comprehensive foundation for the study of the modern media. It has been systematically compiled to map the field in a way which corresponds to the curricular organization of the field around the globe, providing a complete resource for students in their third year to graduate level courses in the U.S.', 945, 'Drive set I mother central husband.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (65, 'Greening the Media', 'Richard Maxwell, Toby Miller', 'Oxford University Press', 44.04, 'Social Science', 'http://books.google.com/books/content?id=Qt7JnVgUMIIC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'You will never look at your cell phone, TV, or computer the same way after reading this book. Greening the Media not only reveals the dirty secrets that hide inside our favorite electronic devices; it also takes apart the myths that have pushed these gadgets to the center of our lives. Marshaling an astounding array of economic, environmental, and historical facts, Maxwell and Miller debunk the idea that information and communication technologies (ICT) are clean and ecologically benign. The authors show how the physical reality of making, consuming, and discarding them is rife with toxic ingredients, poisonous working conditions, and hazardous waste. But all is not lost. As the title suggests, Maxwell and Miller dwell critically on these environmental problems in order to think creatively about ways to solve them. They enlist a range of potential allies in this effort to foster greener media--from green consumers to green citizens, with stops along the way to hear from exploited workers, celebrities, and assorted bureaucrats. Ultimately, Greening the Media rethinks the status of print and screen technologies, opening new lines of historical and social analysis of ICT, consumer electronics, and media production.', 708, 'Head everyone during small cell town.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (66, 'A Geology of Media', 'Jussi Parikka', 'U of Minnesota Press', 96.64, 'Social Science', 'http://books.google.com/books/content?id=UzB0DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Media history is millions, even billions, of years old. That is the premise of this pioneering and provocative book, which argues that to adequately understand contemporary media culture we must set out from material realities that precede media themselves—Earth’s history, geological formations, minerals, and energy. And to do so, writes Jussi Parikka, is to confront the profound environmental and social implications of this ubiquitous, but hardly ephemeral, realm of modern-day life. Exploring the resource depletion and material resourcing required for us to use our devices to live networked lives, Parikka grounds his analysis in Siegfried Zielinski’s widely discussed notion of deep time—but takes it back millennia. Not only are rare earth minerals and many other materials needed to make our digital media machines work, he observes, but used and obsolete media technologies return to the earth as residue of digital culture, contributing to growing layers of toxic waste for future archaeologists to ponder. He shows that these materials must be considered alongside the often dangerous and exploitative labor processes that refine them into the devices underlying our seemingly virtual or immaterial practices. A Geology of Media demonstrates that the environment does not just surround our media cultural world—it runs through it, enables it, and hosts it in an era of unprecedented climate change. While looking backward to Earth’s distant past, it also looks forward to a more expansive media theory—and, implicitly, media activism—to come.', 366, 'Since rather reach structure hard effort.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (67, 'Media Madness: The Corruption of Our Political Culture (Large Print 16pt)', 'James Bowman', 'ReadHowYouWant.com', 54.57, '', 'http://books.google.com/books/content?id=RqF4CG5VU_IC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Although there is widespread acknowledgment that the mainstream media is in crisis - a crisis underscored as much by declining authority as declining circulation and viewership - no one has explained its intellectual and moral causes. James Bowman\' media critic for The New Criterion\' provides a scintillating and fast - paced anatomy of the mainstream media self - generated demise. In Media Madness\' Bowman looks behind the headlines to examine mainstream media\'s governing myths. Writing with acerbic wit\' he shows how the mainstream media\'s embrace of a spurious notion of objectivity combined with its addiction to scandal\' moral equivalence\' and an unshakable conviction of its own moral superiority have done irreparable damage to the media\'s public authority and have helped precipitate a worldwide exodus to the blogosphere and other sources of news and comment.', 164, 'Better recognize film ground.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (68, 'Writing for Visual Media', 'Anthony Friedmann', 'Taylor & Francis', 79.05, 'Electronic books', 'http://books.google.com/books/content?id=MwtjdtT0fJkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Writing for Visual Media looks at the fundamental problems a writer faces in learning to create content for media that is to be seen rather than read. It takes you from basic concepts to practice through a seven-step method that helps you identify a communications problem, think it through, and find a resolution before beginning to write. Through successive exercises, Writing for Visual Media helps you acquire the basic skills and confidence you need to write effective films, corporate and training videos, documentaries, web sites, PSAs, TV shows, nonlinear media, and other types of visual narratives. You\'ll explore your visual imagination and try out your powers of invention. The companion web site enriches the content of the printed book with video, audio, and sample scripts. It includes scripts and the video produced from them; visual demonstrations of concepts; and an interactive, illustrated glossary of terms and concepts. Please visit www.focalpress.com/cw/friedmann-9780240812359 click on the Interactive Content tab, and follow the registration instructions.', 153, 'There expect find grow energy heart.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (69, 'The Sciences’ Media Connection –Public Communication and its Repercussions', 'Simone Rödder, Martina Franzen, Peter Weingart', 'Springer Science & Business Media', 85.43, 'Social Science', 'http://books.google.com/books/content?id=ZvhFPCQ-2m4C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'The Yearbook addresses the overriding question: what are the effects of the ‘opening up’ of science to the media? Theoretical considerations and a host of empirical studies covering different configurations provide an in-depth analysis of the sciences’ media connection and its repercussions on science itself. They help to form a sound judgement on this recent development.', 437, 'Avoid ask east street wear girl.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (70, 'Insect Media', 'Jussi Parikka', 'U of Minnesota Press', 49.93, 'Science', 'http://books.google.com/books/content?id=cLbYMCjAXY8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Since the early nineteenth century, when entomologists first popularized the unique biological and behavioral characteristics of insects, technological innovators and theorists have proposed insects as templates for a wide range of technologies. In Insect Media, Jussi Parikka analyzes how insect forms of social organization-swarms, hives, webs, and distributed intelligence-have been used to structure modern media technologies and the network society, providing a radical new perspective on the interconnection of biology and technology. Through close engagement with the pioneering work of insect ethologists, including Jakob von Uexküll and Karl von Frisch, posthumanist philosophers, media theorists, and contemporary filmmakers and artists, Parikka develops an insect theory of media, one that conceptualizes modern media as more than the products of individual human actors, social interests, or technological determinants. They are, rather, profoundly nonhuman phenomena that both draw on and mimic the alien lifeworlds of insects. Deftly moving from the life sciences to digital technology, from popular culture to avant-garde art and architecture, and from philosophy to cybernetics and game theory, Parikka provides innovative conceptual tools for exploring the phenomena of network society and culture. Challenging anthropocentric approaches to contemporary science and culture, Insect Media reveals the possibilities that insects and other nonhuman animals offer for rethinking media, the conflation of biology and technology, and our understanding of, and interaction with, contemporary digital culture.', 310, 'Voice so whether hit.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (71, 'Lit Chat', 'Book Riot', 'ABRAMS', 91.57, 'Literary Criticism', 'http://books.google.com/books/content?id=YNA1DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Get the conversation started—at your book club, writer’s group, or any friendly get-together—with these 100 reading-themed questions. Some invoke books that are tied to memories (name your favorite childhood picture book); others prompt you to choose ideal reading material for a hypothetical situation (if you were stranded on a desert island, what book would you want with you?). Some of them aim to get people comparing their favorite (and not-so-favorite) characters or authors, and others engage in popular debates among readers (name a movie adaptation you liked and defend your choice). Created to give readers of all persuasions an excuse to talk about books, ideas, and life itself, this collection from the largest independent community for book lovers in North America is a delight for any bibliophile. Reading is a solitary experience—but being a reader is a shared experience, and that shared experience is what Lit Chat is all about.', 846, 'Wide keep message owner knowledge.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (72, 'Church Chat', 'Tom Smith', 'iUniverse', 17.39, '', 'http://books.google.com/books/content?id=tMDwBQAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'On March 13, 2013, the Catholic Church changed dramatically when Pope Francis I, the Argentine slum walker, immediately began to redefine the papacy. His refreshing yet humble leadership collides with the approach of previous popes and revives the themes of the Second Vatican Council. In Church Chat, author Tom Smith catalogues that remarkable transition in an entertaining and thought provoking style. A collection of previously published columns dating from 2009 and into 2014, Church Chat fearlessly displays some flaws of the Catholic Church while applauding the leadership of Pope Francis. It is written by a progressive, and still practicing, Catholic who insists \"It\'s my Church, too!\" Transition times stir things up, cause unusual hopes and fears, bring stuff at the bottom to the top and take one set of priorities and replace them with another. Things move quickly during major transitions, what was standard at one time is replaced by a new approach. Since this new period is just beginning, we don\'t know how it will turn out, but one thing is certain: these are historic times in the Catholic Church. Pope Francis is moving quickly on many fronts and the vision of Vatican II is growing some flesh. Finally. \"Every Catholic -- liberal, conservative, or confused -- will benefit from Tom Smith\'s intelligent book Church Chat. I highly recommend this lively and loving book.\" -Michael Leach, author of Why Stay Catholic? Unexpected Answers to a Life-Changing Question \"Church Chat is a great read for veteran Church reformers as well as for people in the pews. The issue treatment is very comprehensive and right on... all done in a friendly conversational style. The reader thus comes away with a window into a hope filled near future for the People of God as well as a warm connection with Tom on his soulful journey forward.\" -Dan and Sheila Daley, Co-Founders of Call to Action', 563, 'Tv five building social.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (73, 'Me and My God Ava Chat', 'Edward J. B.', 'Balboa Press', 24.99, 'Religion', 'http://books.google.com/books/content?id=MyAXEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Me and My Godship Ava Chat, is a series of inner chats with the writer\'s personal God. The main theme is one of Love and the ease of having Love embrace the everyday happenings. Free will and choices,plus the responsibilities involved. It is a joyful journey of inner contentment, done with ease. The intention is to flood the reader with a Love mantle whenever invoked. There is no chronological order, and an intent is that whatever page is opened, a resolution is applicable. It was fun transcribing and perhaps there may be more chats along the way. Enjoy. Edward J B.', 448, 'Right control special course.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (74, 'Coffee Chat on Improving the Quality of Our Life Experiences', 'Steve Moloney', 'Lulu.com', 73.30, '', 'http://books.google.com/books/content?id=QMVSDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Unknown', 353, 'Conference operation call but while.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (75, 'Neck & Neck', 'Elise Parsley', 'Little, Brown Books for Young Readers', 58.24, 'Juvenile Fiction', 'http://books.google.com/books/content?id=UyY4DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'In this crowd-pleasing read-aloud from the creator of the bestselling If You Ever Want to Bring an Alligator to School, Don\'t!, a giraffe\'s self-esteem is tested during a hilarious confrontation between unlikely look-alikes! Everybody loves Leopold the giraffe. He inspires awe and wonder. His adoring fans gaze and cheer. Best of all, they feed him lots of deeeelicious snacks! But, one day, a shiny, bobble-headed new rival comes in and ruins everything...a giraffe-shaped balloon! Just how far will Leopold go to prove that he\'s the hero of the zoo? Readers learn that actions speak far louder than looks in this laugh-out-loud face-off from Elise Parsley--the New York Times bestselling creator of the Magnolia Says DON\'T! series.', 386, 'Picture case state hit.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (76, 'Chat Reference', 'Jana Ronan', 'Libraries Unlimited', 32.56, 'Language Arts & Disciplines', 'http://books.google.com/books/content?id=q9HgAAAAMAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', 'Functioning as a blueprint, this guide leads the reader through the many decisions and considerations involved in setting up a real-time reference service. Ronan introduces both basic and advanced real-time reference software, offers practical information about features, advantages, and disadvantages, and discusses human and organizational issues. How does one start a virtual reference service? What types of software are available? This comprehensive guide to live virtual services answers these and other questions. Intended as a blueprint, the book is designed to lead the reader through the many decisions and considerations involved in setting up a real-time reference service. Acclaimed expert Jana Smith Ronan introduces both basic and advanced real-time reference software, offers practical information about features, advantages, and disadvantages, and discusses human and organizational issues, such as staffing, training, and administration. Complete with five case studies from successful real-time reference services, this guide provides readers with a better understanding of real-time reference and an ability to make educated decisions on what\'s best for their library and their patrons.', 22, 'Force answer pressure prepare identify have chair.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (77, 'FDR’s First Fireside Chat', 'Amos Kiewe', 'Texas A&M University Press', 28.26, 'Political Science', 'http://books.google.com/books/content?id=Itc2YqY3_j4C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '“I want to talk for a few minutes with the people of the United States.” Thus began not only the first of Franklin Roosevelt’s celebrated radio addresses, collectively called Fireside Chats, but also the birth of the media era of the rhetorical presidency. Humorist Will Rogers later said that the president took “such a dry subject as banking and made everyone understand it, even the bankers.” Roosevelt also took a giant step toward restoring confidence in the nation’s banks and, eventually, in its economy. Amos Kiewe tells the story of the First Fireside Chat, the context in which it was constructed, the events leading to the radio address, and the impact it had on the American people and the nation’s economy. Roosevelt told America, “The success of our whole national program depends, of course, on the cooperation of the public—on its intelligent support and its use of a reliable system.” Kiewe succinctly demonstrates how the rhetoric of the soon-to-be-famous First Fireside Chat laid the groundwork for that support and the recovery of American capitalism.', 224, 'Outside character become.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
