INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (80, 'Chats in the Book-Room', 'Horace N. Pym', 'Good Press', 54.82, 'Fiction', 'http://books.google.com/books/content?id=qJrcEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '\"Chats in the Book-Room\" by Horace N. Pym is a delightful and enlightening collection of literary conversations that provides readers with a cozy and intimate journey into the world of books and authors. Pym\'s narrative style creates an inviting atmosphere where literature enthusiasts can engage in relaxed discussions about their favorite works and writers. The book serves as a pleasant refuge for those seeking to explore the depths of literary treasures and engage in thoughtful conversations about the written word. \"Chats in the Book-Room\" is a charming addition to the world of literary discourse, offering a space where the joy of reading and the love of books can be celebrated and shared.', 501, 'Back anyone especially act care.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (81, 'The Animal Book', 'David Burnie', 'Penguin', 72.89, 'Juvenile Nonfiction', 'http://books.google.com/books/content?id=vWTyAAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'If you\'re wild about animals, this visual encyclopedia is the ultimate page-turner, bringing our planet\'s creatures together in spectacular style. This inspiring children\'s reference guide welcomes you to the animal kingdom where you can meet more than 1,500 species, ranging from ants to zebras and everything in between. Stunning pictures bring you face to face with giant predators you know and love, including polar bears and tigers, as well as mysterious microscopic life, including amoebas and bacteria. A variety of animal habitats are shown in beautiful detail, while accessible information, additional fact boxes, and amazing galleries complete the stories. A jaw-dropping spectrum of animal types - from fish and birds to reptiles and mammals - provides a learning experience like no other. Whether you\'re a budding naturalist or simply want to complete a school project, The Animal Book has got it covered.', 479, 'Hit certainly positive difference.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
