INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (85, 'On Animals', 'Susan Orlean', 'Simon and Schuster', 78.96, 'Nature', 'http://books.google.com/books/content?id=zuMYEAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'NATIONAL BESTSELLER “Magnificent.” —The New York Times * “Beguiling, observant, and howlingly funny.” —San Francisco Chronicle * “Spectacular.” —Star Tribune (Minneapolis) * “Full of astonishments.” —The Boston Globe Susan Orlean—the beloved New Yorker staff writer hailed as “a national treasure” by The Washington Post and the author of the New York Times bestseller The Library Book—gathers a lifetime of musings, meditations, and in-depth profiles about animals. “How we interact with animals has preoccupied philosophers, poets, and naturalists for ages,” writes Susan Orlean. Since the age of six, when Orlean wrote and illustrated a book called Herbert the Near-Sighted Pigeon, she’s been drawn to stories about how we live with animals, and how they abide by us. Now, in On Animals, she examines animal-human relationships through the compelling tales she has written over the course of her celebrated career. These stories consider a range of creatures—the household pets we dote on, the animals we raise to end up as meat on our plates, the creatures who could eat us for dinner, the various tamed and untamed animals we share our planet with who are central to human life. In her own backyard, Orlean discovers the delights of keeping chickens. In a different backyard, in New Jersey, she meets a woman who has twenty-three pet tigers—something none of her neighbors knew about until one of the tigers escapes. In Iceland, the world’s most famous whale resists the efforts to set him free; in Morocco, the world’s hardest-working donkeys find respite at a special clinic. We meet a show dog and a lost dog and a pigeon who knows exactly how to get home. Equal parts delightful and profound, enriched by Orlean’s stylish prose and precise research, these stories celebrate the meaningful cross-species connections that grace our collective existence.', 888, 'Thing including economy cup.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (86, 'Talking to Animals', 'Jon Katz', 'Simon and Schuster', 72.39, 'Nature', 'http://books.google.com/books/content?id=viqMDAAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'New York Times bestselling author Jon Katz—“a Thoreau for modern times” (San Antonio Express-News)—offers us a deeper understanding of the inner lives of animals and teaches us how we can more effectively communicate with them, made real by his own remarkable experiences with a wide array of creatures great and small. In Talking to Animals, journalist Jon Katz—who left his Manhattan life behind two decades ago for life on a farm where he is surrounded by dogs, cats, sheep, horses, cows, goats, and chickens—marshals his experience to offer us a deeper insight into animals and the tools needed for effectively communicating with them. Devoting each chapter to a specific animal from his life, Katz tells funny and illuminating stories about his profound experiences with them, showing us how healthy engagement with animals falls into five key areas: Food, Movement, Visualization, Language, and Instincts. Along the way, we meet Simon the donkey who arrives at Katz’s farm near death and now serves as his Tai Chi partner. We meet Red the dog who started out antisocial and untrained and is now a therapy dog working with veterans from Iraq and Afghanistan. And we meet Winston, the dignified and brave rooster who was injured defending his hens from a hawk and who has better interpersonal skills than most humans. Thoughtful and intelligent, lively and powerful, this book will completely change the way you think about and interact with animals. Katz’s “honest, straightforward, and sometimes searing prose will speak to those who love animals, and might well convert some who do not” (Booklist).', 258, 'Least sister name.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (87, 'Animals', 'Emma Jane Unsworth', 'Penguin', 72.80, 'Fiction', 'http://books.google.com/books/content?id=UOAaCgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'It is the moment every twenty-something must confront: the time to grow up. Adulthood looms, with all it\'s numbing tranquility and stifling complacency. The end of prolonged adolescence is near. Laura and Tyler are two women whose twenties have been a blur of overstayed parties, a fondness for drugs that has shifted from cautious experimentation to catholic indulgence, and hangovers that don\'t relent until Monday morning. They\'ve been best friends, partners in excess, for the last ten years. But things are changing: Laura is engaged to Jim, a classical pianist who has long since given up the carousing lifestyle. He disapproves of Tyler\'s reckless ways and of what he percieves to be her bad influence on Laura. Jim pulls Laura toward adulthood and responsibility, toward what society says she should be, but Tyler isn\'t ready to let her go. But what does Laura want for herself? And how can she choose between Tyler and Jim, between one life she loves and another she\'s \"supposed\" to love? Raw, uproarious, and deeply affecting, Animals speaks to an entire generation caught between late-adolescence and adulthood wondering what exactly they\'ll have to give up in order to grow up.', 270, 'About among hour account perhaps build be whether.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (88, 'D\'Aulaires\' Book of Animals', 'Ingri d\'Aulaire, Edgar Parin d\'Aulaire', 'New York Review of Books', 17.67, 'Juvenile Fiction', 'http://books.google.com/books/content?id=8a1nX9k2UjkC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'THE CELEBRATED HUSBAND-AND-WIFE TEAM OF INGRI AND EDGAR PARIN D’AULAIRE prepared this exceptionally beautiful volume for their own son Ola, and it is as fresh and enchanting today as it was when it ﬁrst sprung from their imaginations. D’Aulaires’ Book of Animals introduces young children to the creatures of every continent. Here more than ﬁfty animals lithographed in full color form one side of a book that can be read page by page or unfolded to form a continuous panorama; the flipside of the panorama reveals the nighttime world of the animals in the very same settings. Each tableau presents the subjects in their native environments—from the tropical to the arctic—and is rendered with the exemplary richness of color and delightful understanding of the children’s world that distinguish the d’Aulaires’ much-loved retellings of the Norse and Greek myths and their wildly playful Book of Trolls. Young children, meeting animals from all over the world for the ﬁrst time, will be delighted not only with the animals themselves but with the simple and engaging text which provides information about the way they act, the world they live in, and—best of all—the sounds they make. D’Aulaires’ Book of Animals is not only a perfect picture book for preschoolers, but a work of art that can be enjoyed by all.', 645, 'Bill into analysis five.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (89, 'Wild Animals I Have Known', 'Ernest Thompson, Ernest Thompson Seton', 'Metro Publishing', 47.09, 'Biography & Autobiography', 'http://books.google.com/books/content?id=wie3DwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', '\'The most precious book of my childhood’ – Sir David Attenborough Meet Old Lobo, a gigantic grey wolf whose death-defying predations on sheep and cattle herds are the scourge of farmers and ranchers in the Currumpaw region of northern New Mexico. This great wolf is just one of the animals whose true stories come to life in this engrossing collection of tales by the celebrated naturalist Ernest Thompson Seton (1860-1946). Combining scientific observations of animals in their natural habitats with a romantic vision of nature and the narrative skills of a born storyteller, Seton created an extraordinary collection of tales that gave the animal story new force and believability as a literary genre. Critically and popularly acclaimed upon its initial appearance in 1898, Wild Animals I Have Known remains, more than a century later, the best-known and best-loved of his works. Each tale focuses on an individual creature: the clever crow, Silverspot; Raggylug, a young cottontail rabbit; the author\'s errant hound, Bingo; Redruff, a Don Valley partridge; a wild horse known as The Mustang; Vixen, The Springfield Fox; and Wully, faithful sheep dog by day and treacherous killer by night. Seton offers affectionate but realistic portraits of each animal, stressing the commonality between his subjects and their human neighbours. In addition to his popular wildlife stories, the author is well known for his work as an illustrator and painter. This edition faithfully reproduces the layout of the original volume, as well as all 200 of the author\'s distinctive illustrations. Animal lovers, environmentalists, naturalists, and any reader who appreciates a lively yarn will cherish this memorable wildlife classic.', 922, 'Bag man similar rule teacher.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (90, '100 Animal Words', 'Unknown', 'Silver Dolphin Books', 87.65, 'Juvenile Nonfiction', 'http://books.google.com/books/content?id=39sAygEACAAJ&printsec=frontcover&img=1&zoom=1&source=gbs_api', 'Introduce your little ones to animals with this early learning book! Bright pictures and labels encourage children to look, point, and learn as they are introduced to 100 animal words! With adorable illustrations by Dawn Machell and a padded cover format, 100 Animal Words is the perfect book for little learners.', 710, 'Respond over rule long finish popular.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
