INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (92, 'The Inn at Rose Harbor', 'Debbie Macomber', 'Random House Digital, Inc.', 90.59, 'Bed and breakfast accommodations', 'http://books.google.com/books/content?id=rx4GCBCzgsoC&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Jo Marie Rose opens the Rose Harbor Inn bed and breakfast in Cedar Cove in order to start a new life, but the inn and its first guests bring surprises into Jo\'s life.', 21, 'Edge several line able.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (93, 'Get to the Point!', 'Joel Schwartzberg', 'Berrett-Koehler Publishers', 47.21, 'Business & Economics', 'http://books.google.com/books/content?id=7EHKDgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'Whether you want to improve your impact in speeches, staff meetings, pitches, emails, PowerPoint presentations, or any other communication setting, this book provides a novel approach that teaches you how to go from simply sharing a thought to making a difference. --', 749, 'Network kind movement yet capital recent blue.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (94, 'Discovering Fiction Level 1 Student\'s Book', 'Judith Kay, Rosemary Gelshenen', 'Cambridge University Press', 51.98, 'Foreign Language Study', 'http://books.google.com/books/content?id=rFHHAgAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'North American short stories enhance students\' reading skills, language learning, and enjoyment of literature. Discovering Fiction, Second Edition, Student\'s Book 1 presents stories with universal appeal to engage students and make them think critically. Among the authors included are O. Henry, William Saroyan, Gwendolyn Brooks, Isaac Asimov, and Sandra Cisneros. Extensive pre-reading activities capture students\' interest. Post-reading activities check their comprehension, increase their knowledge of grammar and vocabulary, and provide thought-provoking discussion and writing assignments. Literary term explanations and tasks enhance students\' appreciation of literature.', 742, 'Live step husband free.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
