INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (97, 'God Quest', 'Jonathan M. George', 'Unknown', 33.11, '', '', '\"Only an encounter with God manifest in the flesh will convince Brianna that God is one. Join Brianna Elliott, as she and her brother, Seth, travel back in time in their quest to find God. Will she be able to find the One who created the world? Or will He find her?\"--', 909, 'Add card happy push.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (98, 'Send for Me', 'Lauren Fox', 'Vintage', 69.72, 'Fiction', 'http://books.google.com/books/content?id=vgLlDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'A NEW YORK TIMES NOTABLE BOOK • NEW YORK TIMES BESTSELLER • An achingly beautiful work of historical fiction that moves between Germany on the eve of World War II and present-day Wisconsin, unspooling a thread of love, longing, and the powerful bonds of family. • A TODAY SHOW #ReadWithJenna BOOK CLUB PICK! Based on the author’s own family letters, Send for Me tells the story of Annelise, a young woman in prewar Germany. Growing up working at her parents’ popular bakery, she\'s always imagined a future full of delicious possibilities. Despite rumors that anti-Jewish sentiment is on the rise, Annelise and her parents can’t quite believe that it will affect them; they’re hardly religious. But as she falls in love, marries, and gives birth to her daughter, the dangers grow closer. Soon Annelise and her husband are given the chance to leave for America, but they must go without her parents, whose future and safety are uncertain. Two generations later in a small Midwestern city, Annelise’s granddaughter, Clare, is a young woman newly in love. But when she stumbles upon a trove of the letters her great-grandmother wrote from Germany after Annelise\'s departure, she sees the history of her family’s sacrifices in a new light, leading her to question whether she can still honor the past while planning for her future.', 611, 'A front your shoulder beyond.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (99, 'The Man in the High Castle', 'Philip K. Dick', 'Houghton Mifflin Harcourt', 51.33, 'Fiction', 'http://books.google.com/books/content?id=NtukmPtq2l8C&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'In a classic work of alternate history, the United States is divided up and ruled by the Axis powers after the defeat of the Allies during World War II. Reissue. Winner of the Hugo Award for Best Novel.', 438, 'Nothing feel consider deep decade collection former blood.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
INSERT INTO `Books` (`BookID`, `Title`, `Authors`, `Publisher`, `Price`, `Keywords`, `CoverImage`, `Contents`, `StockQuantity`, `SeriesInfo`, `createdAt`, `updatedAt`) VALUES (100, 'Elements of Fiction', 'Walter Mosley', 'Grove Press', 44.71, 'Literary Criticism', 'http://books.google.com/books/content?id=0heSDwAAQBAJ&printsec=frontcover&img=1&zoom=1&edge=curl&source=gbs_api', 'The renowned novelist and author of This Year You Write a Novel shares a “compact but insight-rich” guide to fiction writing (Publishers Weekly). In his essential writing guide, This Year You Write Your Novel, Walter Mosley supplied aspiring writers with the basic tools to write a novel in one year. In this complementary follow up, Mosley guides the writer through the elements of not just any fiction writing, but the kind of writing that transcends convention and truly stands out. For writers who want to approach the genius of Melville, Dickens, or Twain, The Elements of Fiction is a must-read. Mosley demonstrates how to master fiction’s most essential elements: character and char-acter development, plot and story, voice and narrative, context and description, and more. The result is a vivid depiction of the writing process, from the blank page to the first draft to rewriting, and rewriting again. Throughout, The Elements of Fiction is enriched by brilliant demonstrative examples that Mosley himself has written here for the first time.', 293, 'Fight bad hospital phone father.', '2023-12-30 02:07:09', '2023-12-30 02:07:09');
